bool DrawSplash() { 

	glBegin(GL_TRIANGLES);
		for (int i=0; i< SPLASHTRIANGLE ;i+=9)
		{
			if (splashTriangle[i+1]==0.0)
				glColor3ub(220,220,220);
			else
				glColor3ub(55,67,123);
				//glColor3ub(100,10,10);

			glVertex3d(
				splashTriangle[i],
				splashTriangle[i+1],
				splashTriangle[i+2]
				);

			if (splashTriangle[i+4]==0.0)
				glColor3ub(220,220,220);
			else
				glColor3ub(55,67,123);
				//glColor3ub(100,10,10);

			glVertex3d(
				splashTriangle[i+3],
				splashTriangle[i+4],
				splashTriangle[i+5]
				);

			if (splashTriangle[i+7]==0.0)
				glColor3ub(220,220,220);
			else
				glColor3ub(55,67,123);

				//glColor3ub(100,10,10);

			glVertex3d(
				splashTriangle[i+6],
				splashTriangle[i+7],
				splashTriangle[i+8]
				);		
		}


	glEnd();
	


return true;
}
